def check_password():
    """Returns `True` if the user has entered the correct password."""

    if "password_correct" not in st.session_state:
        st.session_state.password_correct = False

    if st.session_state.password_correct:
        return True

    # Enhanced password page styling
    st.markdown("""
        <style>
        .password-title {
            font-family: 'VT323', monospace;
            font-size: 4rem !important;
            color: #FFFFFF;
            text-shadow: 3px 3px 0px #000000;
            text-align: center;
            margin-bottom: 2rem;
        }
        </style>
    """, unsafe_allow_html=True)
    
    st.markdown('<p class="password-title">ðŸ”’ Private Birthday Zone ðŸ”’</p>', unsafe_allow_html=True)
    password = st.text_input("Please enter the password to continue:", type="password")

    if password == "0608":
        st.session_state.password_correct = True
        st.rerun()
    elif password:
        st.error("âŒ Wrong Password! Please try again. Hint: It's a special date!")
    
    return False

